local function Hoop()
	for i,v in pairs(game:GetDescendants()) do
		if v.Name == 'Hoop' then
			v.CFrame = game.Players.LocalPlayer.Character.HumanoidRootPart.CFrame
			wait(0.02)
		end
	end
end

